description:
Caracas Onto Death (Venezuela - 2000) Caracas amor a muerte

Drama

3 Award Wins and 1 Nomination - Best Film in Los Angeles, Bogota, Miami
 &lt;a href=&quot;
http://www.imdb.com/title/tt0247796/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.imdb.com/title/tt0247796/&lt;/a&gt;


Director Gustavo Balzo sensitively explores the predicament facing Aixa, a teenager from the slums of Caracas, Venezuela, who discovers she's pregnant thanks to her drug-peddling boyfriend. While her priest counsels her to keep the baby, her grandmother exhorts Aixa to get an abortion, leaving her on the horns of a dilemma.


